import React from 'react'

function CreatePopup(props) {
  return (props.trigger)?(
    <div className='popup'>
      <div className="popup-inner">
      <h1>hi</h1>
        <button className="close-btn">close</button>
        { props.children }
      </div>
    </div>
  ) : ""
}

export default CreatePopup
